import React, { useState } from "react";
import "./contact.css"; // Import your CSS file for styling

const NewContactForm = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here, you can send the formData to your backend or perform any necessary actions
    console.log("Form data:", formData);
    // Reset the form fields after submission
    setFormData({
      name: "",
      email: "",
      message: "",
    });
  };

  return (
    <div className="container">
      <div className="contact-heading">
        <h1>Contact Us</h1>
        <div className="heading-underline"></div>
      </div>

      <div className="card-container">
        <div className="card">
          <div className="upper-section">
            {/* Upper section with image */}
            <img src="/Mohit.jpg" alt="Member" />
          </div>
          <hr /> {/* Divider between upper and lower sections */}
          <div className="lower-section">
            {/* Contact info */}
            <h3>Member Name</h3>
            <p>Email: example@example.com</p>
            <p>Phone: +123456789</p>
          </div>
        </div>
        <div className="card">
          <div className="upper-section">
            {/* Upper section with image */}
            <img src="/Arsola.jpg" alt="Member" />
          </div>
          <hr /> {/* Divider between upper and lower sections */}
          <div className="lower-section">
            {/* Contact info */}
            <h3>Member Name</h3>
            <p>Email: example@example.com</p>
            <p>Phone: +123456789</p>
          </div>
        </div>
        <div className="card">
          <div className="upper-section">
            {/* Upper section with image */}
            <img src="/Ranjdeep.jpg" alt="Member" />
          </div>
          <hr /> {/* Divider between upper and lower sections */}
          <div className="lower-section">
            {/* Contact info */}
            <h3>Member Name</h3>
            <p>Email: example@example.com</p>
            <p>Phone: +123456789</p>
          </div>
        </div>
        <div className="card">
          <div className="upper-section">
            {/* Upper section with image */}
            <img src="/PokPok.jpg" alt="Member" />
          </div>
          <hr /> {/* Divider between upper and lower sections */}
          <div className="lower-section">
            {/* Contact info */}
            <h3>Member Name</h3>
            <p>Email: example@example.com</p>
            <p>Phone: +123456789</p>
          </div>
        </div>
      </div>

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input
            type="text"
            className="form-control"
            id="name"
            name="name"
            placeholder="Enter your name"
            value={formData.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email address</label>
          <input
            type="email"
            className="form-control"
            id="email"
            name="email"
            placeholder="Enter your email"
            value={formData.email}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="message">Message</label>
          <textarea
            className="form-control"
            id="message"
            name="message"
            rows="5"
            placeholder="Write your message here"
            value={formData.message}
            onChange={handleInputChange}
            required
          ></textarea>
        </div>
        <button type="submit" className="btn btn-primary">
          Submit
        </button>
      </form>
    </div>
  );
};

export default NewContactForm;
